function addAttributeConnectionsAsLinks() {
    this.target.withAllSubmorphsDo(function(ea) { 
    if (ea.attributeConnections) {
        ea.attributeConnections.forEach(function(con) {
            if (this.morphs[con.targetObj.id])
            this.data.links.push({
                source: this.morphs[ea.id].index, target: this.morphs[con.targetObj.id].index, weight: 0.5})
        }, this)
    }
}, this)
}

